import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

serviceWorker.unregister();

class HomePage extends React.Component {
  render(){
    return (
      <div>This is all about Sheldon... and his <i>Highly Kinetic Mobile Art</i></div>
    )
  }
}

ReactDOM.render(
  <HomePage />,
  document.getElementById('root')
);
